import React from "react";

import { Nav, NavbarContainer, NavLogo } from "./NavbarElements";
import img from "../../images/krpurrect.jpg";

const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo to="/" src={img}>
            {$("img")}
          </NavLogo>
          i
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
